import React from "react";
import AddPorjectModal from "../Modals/addProject";
import styles from "./home.module.css";
import Button from "@mui/material/Button";
import ProjctionTable from "./projction/projctionTable";
import { useSelector } from "react-redux";
export default function Home() {
  const { projctions } = useSelector((state) => state.projction);
  const [open, setOpen] = React.useState(false);
  const [projction, setProjction] = React.useState("");
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleClick = () => {
    if(projctions.length ===0 ){
      const date = new Date();
      setProjction(
        `projection_${date.getDate()}/${date.getMonth()}/${date.getFullYear()}_${date.getHours()}:${date.getMinutes()}`

      ); 
    }
    handleOpen();
  };
  return (
    <div className={styles["container"]}>
        <Button
          variant="contained"
          onClick={handleClick}
          className={styles["btnCenter"]}
        >
          {projctions.length === 0 ? "New" : "Edit" } Project
        </Button>
      <AddPorjectModal
        projctionName={projction}
        projectView={projctions}
        open={open}
        handleOpen={handleOpen}
        handleClose={handleClose}
      />
      <ProjctionTable projctions={projctions} />
    </div>
  );
}
